现代文字大多是记录语言的工具。人类往往先有口头的语言后产生书面文字，很多小语种，有语言但没有文字。文字的不同体现了国家和民族的书面表达的方式和思维不同。文字使人类进入有历史记录的文明社会。文字按字音和字形，可分为表形文字、表音文字和意音文字。按语音和语素，可分为音素文字、音节文字和语素文字。 表形文字是人类早期原生文字的象形文字，比如：古埃及的圣书字、两河流域的楔形文字、古印度文字、美洲的玛雅文和早期的汉字。意音文字是由表义的象形符号和表音的声旁组成的文字，汉字是由表形文字进化成的表意文字，汉字也是语素文字，也是一种二维文字。<br><br><br><br><br><br><br>中文名<br><br>文字<br><br>外文名<br><br>characters<br><br>拼    音<br><br>wén zì<br><br><br><br>定    义<br><br>文字是语言的符号<br><br>例    子<br><br>汉字、英文、俄文<br><br>要    素<br><br>音（语音）、形（字符）、义（意义）<br><br><br><br><br><br><br>目录<br><br><br><br>1<br>文字概念<br><br><br>▪<br>定义<br><br><br>▪<br>分类<br><br><br>▪<br>要素<br><br><br>▪<br>属性<br><br><br>2<br>发展史<br><br><br>3<br>中国汉字<br><br><br>▪<br>汉字历史<br><br><br>▪<br>汉字演变<br><br><br>▪<br>汉字性质<br><br><br><br><br><br><br><br><br><br><br><br>文字文字概念<br>编辑<br><br>播报<br><br><br><br><br><br><br><br><br>文字定义<br><br>文字是人类用表义符号记录表达信息以传之久远的方式和工具。现代文字多是记录语言的工具，人类往往先有口头的语言后产生书面的文字，很多小语种，有语言但没有文字。文与字东汉许慎《〈说文解字〉叙》：“盖依类象形，故谓之文；其后形声相益，即谓之字，”也就是说，“文”是独体字（包含象形字和指事字），而“字”是由独体字组合的合体字（包含会意字、形声字、假借字）。<br>','{\"code\":200,\"msg\":\"操作成功\",\"data\":null}',0,'','2023-07-12 13:12:15',58),(1678999522903662594,'000000','应用扩展信息',2,'org.dromara.biz.thoughts.controller.AppExtendController.edit()','PUT',1,'admin','','/app/extend','0:0:0:0:0:0:0:1','','{\"createDept\":null,\"createBy\":null,\"createTime\":\"2023-07-01 19:01:14\",\"updateBy\":null,\"updateTime\":null,\"extendId\":10000,\"appId\":10000,\"appIds\":null,\"key\":\"懂adsa\",\"label\":\"懂adsa\",\"value\":\"<p>&lt;html&gt;<br>&lt;body&gt;<br>&lt;!--StartFragment--&gt;&lt;div class=\\\"page-header\\\" style=\\\"margin: 15px 0px 0px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Microsoft Yahei&quot;, Simsun; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 25